import './test.css'

export default function Test_list_not_photo({nameCar, brandCar, description}) {

    return (
        <div className="Test_list">
            <div>
                <h5>{nameCar}<span>{brandCar}</span></h5>
                <p>{description}</p>
            </div>
        </div>
    )
}
